import React from 'react';
import {Link} from 'react-router-dom';
import { library } from '@fortawesome/fontawesome-svg-core';
import { faPlayCircle } from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import '../../assets/css/common/videoCards.css'


library.add(faPlayCircle);


const Videos = (props) => {
  const { match } = props;

  if (match.length <= 0) {
    return (<div></div>)
  } else {

    return (
      <div>
        {match.map((video, i) => (
          <div>
            {i === 0 &&
              <div className='card mb-1'>
                  <Link>
                        <div className='video-card-image-size-large'>
                            <img src={video.med_image} alt="no Iamge" />
                            <div className='play-button'>    
                                <FontAwesomeIcon color="white"
                                  icon={"play-circle"}
                                  size="6x"/>
                            </div>
                        </div>

                        <div className="cards-big-videocard-heading">
                          {video.title}
                        </div>
                  </Link>
              </div>
            }

            {i > 0 &&
              <div key={video.id} className="flex-d">
                <div className="card mb-1 p-0">
                  <div className="card-body p-3">
                    <div>
                      <img
                        className="home-center-series-videos-small"
                        src={video.med_image}
                        alt="no Iamge"
                      />
                    </div>

                    <div>
                      {/* <h6 className='home-center-series-article-videos-small-date'>
                      {Moment(
                        new Date(video.created_at)
                      ).format("DD MMM,YYYY")}
                    </h6> */}

                      <h6 className='home-center-series-videos-small-text' >
                        {video.title}
                      </h6>

                      <h6 className='home-center-series-videos-small-text'>
                        {video.match_desc}
                      </h6>
                    </div>
                  </div>
                </div>
              </div>
            }

          </div>
        ))}
      </div>
    )
  }
}

export default Videos;
